INSERT INTO `video` VALUES (10,'https://www.youtube.com/watch?v=HX30jKqwoGE','AlEz TairIo','NOTICE:\nI don\'t own the characters or the textures used in the animation.\nBuilding textures were taken from Google Images.\nI also don\'t own the music,\nThe Amazing Spider-man 2-I\'m Goblin OST by Hans Zimmer',15,32,'Spider man vs The Symbiote (3D Blender Animation).mp4','Spider man vs. The Symbiote (3D Blender Animation)','Spider man vs The Symbiote (3D Blender Animation)'),(11,'https://www.youtube.com/watch?v=CnSNmt7e1YA','Marvel Entertainment','Chaos is on your side. Marvel Studios\' \"Loki\" starts streaming June 9 with new episodes every Wednesday on Disney.\n\n Watch Marvel on Disney+: https://bit.ly/2XyBSIW\n Subscribe to Marvel on YouTube: http://bit.ly/WeO3YJ\n\nFollow Marvel on Twitter: https://twitter.com/marvel\nLike Marvel on Facebook: https://www.facebook.com/marvel\nWatch Marvel on Twitch: https://www.twitch.tv/marvel\n\nReward your Marvel fandom by joining Marvel Insider!\nEarn points, then redeem for awesome rewards.\nTerms and conditions apply. \nLearn more at https://www.marvel.com/insider?Osocial=YT&CID=MarvelInsider\n\nFor even more news, stay tuned to:\nTumblr: http://marvelentertainment.tumblr.com/\nInstagram: https://www.instagram.com/marvel\nPinterest: http://pinterest.com/marvelofficial\nReddit: http://reddit.com/u/marvel-official',15,45,'Chance  Marvel Studios Loki  Disney+.mp4','Chance | Marvel Studios\' Loki | Disney+','Chance  Marvel Studios Loki  Disney+'),(12,'https://www.youtube.com/watch?v=Q4_1pceJ_PE','yao carot','',15,19,'SpiderMan-Unlimited NanoSuit.mp4','SpiderMan-Unlimited NanoSuit','SpiderMan-Unlimited NanoSuit'),(17,'https://www.youtube.com/watch?v=ub_a2ZvzQT4','AkiDream','I AM NOT RUNNING ADS ON THIS VIDEO. THIS VIDEO HAS BEEN CLAIMED BY MARVELOUS, which is 100000% okay!  :)  \n\nThe song is Calling by Kimeru, check it out! - https://www.youtube.com/watch?v=7zOXmeTPjcc\n\n\nCheck out my friend Yugioh Everything for more VRAINS commentary and analysis, if you like that sort of thing!  -  https://www.youtube.com/channel/UCSHgEDgl4EM9WqOxEHb4z9Q',15,110,'Yu-Gi-Oh VRAINS Opening 3 HD (Subbed).mp4','Yu-Gi-Oh VRAINS: Opening 3 HD (Subbed)','Yu-Gi-Oh VRAINS Opening 3 HD (Subbed)'),(18,'https://www.youtube.com/watch?v=TAMiLTiXPpU','BANDMAID','Welcome home,masters & princesses\nBAND-MAID is an impossibly hard rocking maid band.\n\n\"glory\"  music video from  \"CONQUEROR\"\n\nSpotify\nhttps://open.spotify.com/artist/5Wh3G01Xfxn2zzEZNpuYHH\nApple Music\nhttps://music.apple.com/jp/artist/band-maid/1102275947\n\n info\nOfficial HP http://bandmaid.tokyo\nOfficial facebook https://www.facebook.com/bandmaid\nOfficial Twitter https://twitter.com/bandmaid\nOfficial Instagram https://www.instagram.com/bandmaid.jp\n\n#BANDMAID #ROCK #CONQUEROR',15,244,'BAND-MAID  glory (Official Music Video).mp4','BAND-MAID / glory (Official Music Video)','BAND-MAID  glory (Official Music Video)'),(19,'https://www.youtube.com/watch?v=edlLhh8qVxM','BANDMAID','Welcome home,masters & princesses\nBAND-MAID is an impossibly hard rocking maid band.\n\n\"Different\"  music video\n\nThe availability of this song is from December 2.\n\nSpotify\nhttps://open.spotify.com/artist/5Wh3G01Xfxn2zzEZNpuYHH\nApple Music\nhttps://music.apple.com/jp/artist/band-maid/1102275947\n\nThe English translation of the lyrics can be seen in the video.\nYou can use subtitle on Youtube.\n\n\n-------Different------\nWordsMIKU KOBATO\nMusic & ArrangementBAND-MAID\nEnglish translator of Japanese lyrics: S. R. Wallis\n\n\nLet\'s go! It\'s showtime!!\n\nDarkness falls, no guiding light, ordinary seems dazzling.\nMake it a rule, race where you can see.\nCome back to...\nRise from the dead!\n\nGrieving and praying get you nowhere.\nWhat of the Gods? Nobody\'s listening!\nIts hard to believe in existences you can\'t see.\nThe clock is ticking.\n\nOnce more shadows blunt my courage;\nOnce more the loop is reborn.\nNo more! But I wont stop, not yet.\nJust you wait!\n\nTotally different world!\nA flaming torch to my apathy; anguish.\nAwake your potential! \nThe tumbling world\nFlashes and sways away, \nAs if it were real.\n\nLet\'s go! It\'s showtime!!\n\nThree seconds before you sleep.\nIf you could have one more time, where would you go?\nCome back to...\nRise from the dead\n\nMy soul withers, my heart chokes.\nAll my understanding is different now,\nTurned to fiction.\nGet your teeth into that! Fake!\nLost your bearings.\n\nOnce more complete the ring; \nOnce more plunge into the labyrinth.\nNo more! But see, I can still do it.\nJust you wait!\n\nTotally different world!\nA flaming torch to my apathy; anguish.\nAwake your potential! \nA misread future \nMay sunder even the emptiness.\nIt crumbles, and you can smile.\n\nDevil or angel, two sides of the same coin.\nDancing in the clutter. Pa Pa Pa\nComfortable compromises? Do you need them?\nNobody knows.\n\nOneagain somewhere I can hear a Voice.\nTwo timesthe future becomes the past.\nRepeating, layer on layer. \nDo I continue? Start in my life.\n\nYou cant back out now,\nDeep in the dark.\nDon\'t sink!\n\nOnce more shadows blunt my courage; \nOnce more the loop is reborn.\nNo more! But I wont stop, not yet.\nJust you wait!\n\nTotally different world!\nA flaming torch to my apathy; anguish.\nAwake your potential! \nThe tumbling world\nFlashes and sways away, \nAs if it were real.\n\nLet\'s go! It\'s showtime!!\n\nYour time to shine.\n\n\n-------------------------------\n\n-------Different----------\nWordsMIKU KOBATO\nMusic & ArrangementBAND-MAID\n\n\nLet\'s go! It\'s showtime!!\n\n  \nMake it a rule \nCome back to...\nRise from the dead!\n\n\n?? \n\nThe clock is ticking\n\nOnce more \nOnce more  \nNo more \nJust you wait\n\nTotally different world!\n\nAwake your potential \n\n\n\n\nLet\'s go! It\'s showtime!!\n\n 3\n?\nCome back to...\nRise from the dead!\n\n \n \n\n \nLost your bearings\n\nOnce more \nOnce more \nNo more \nJust you wait\n\nTotally different world!\n  \nAwake 